import React from 'react';
import {BrowserRouter, Link, Route, Switch} from "react-router-dom";
import MediList from "./MediList";
import MediSearch from "./Medi-search";
import './cnt.css';
import CntTest from "./cnts/cnttest.js";
import CntTest2 from "./cnts/cnttest2.js";

function CntTable(){
    return(
    <Switch>
        {/*Link 의 URL 과 대응되는 컴포넌트를 Route 로 호출*/}
        {/*정확히 하려면 exact 필수*/}
        <Route path={"/medi-list"} exact={true}>
            <MediList />
        </Route>
        <Route path={"/medi-search"} exact={true}>
            <MediSearch />
        </Route>
    </Switch>
    );
}

export default CntTable;
